Réforme des retraites : la Nupes soucieuse d’afficher un front uni 

« Nous sommes rassemblés pour dire notre opposition à cette contre-réforme », a expliqué l’« insoumise » Clémentine Autain.

@sandrinecassini  https://t.co/4eUYX1NPI8

Ingrédients pour 4 personnes 👇
2 oignons doux, type Cévennes ou Roscoff ;
3 carottes ;
1 branche de céleri ;
300 g de viande de bœuf longue cuisson ;
8 cl d’huile d’olive ;
½ verre de vin blanc ;
500 g de rigatonis ou paccheris ;
parmesan (en option). 

